FeedPackage.ReleaseNotes:
1. Workflow similar to how we use facebook / twitter namespaces.
	2. Examples: 

			// LinkedIn login with app default profile fields 
            app.UseLinkedInAuthentication(new LinkedInOptions()
            {
                AppId = Configuration["Authentication:LinkedIn:AppId"],
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"]
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.AppDefined
            });

			// LinkedIn login with basic profile fields 
            app.UseLinkedInAuthentication(new LinkedInOptions()
            {
                AppId = Configuration["Authentication:LinkedIn:AppId"],
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"]
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.Basic
            });

			// LinkedIn login along with retrieving custom fields
            app.UseLinkedInAuthentication(new LinkedInOptions()
            {
                AppId = Configuration["Authentication:LinkedIn:AppId"],
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"]
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.Custom,
                CustomProfileFields = "first-name,email-address,last-name,formatted-name,id,industry"
            });

	3. Retrieve custom profile fields as json from Identity model "UserData" claim.
	4. References: 
	https://github.com/aspnet/Security/tree/dev/src 
	https://auth0.com/blog/authenticating-a-user-with-linkedin-in-aspnet-core/
	https://developer.linkedin.com/docs/signin-with-linkedin

FeedPackage.Description:
ASP.NET Core middleware that enables an application to support LinkedIn's OAuth 2.0 authentication workflow.

1. Examples: 

// LinkedIn login with app default profile fields 
            app.UseLinkedInAuthentication(new LinkedInOptions() 
            { 
                AppId = Configuration["Authentication:LinkedIn:AppId"], 
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"] 
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.AppDefined 
            }); 

// LinkedIn login with basic profile fields 
            app.UseLinkedInAuthentication(new LinkedInOptions() 
            { 
                AppId = Configuration["Authentication:LinkedIn:AppId"], 
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"] 
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.Basic 
            }); 

// LinkedIn login along with retrieving custom fields 
            app.UseLinkedInAuthentication(new LinkedInOptions() 
            { 
                AppId = Configuration["Authentication:LinkedIn:AppId"], 
                AppSecret = Configuration["Authentication:LinkedIn:AppSecret"] 
                ProfileScheme = LinkedInDefaults.ProfileLoadFormat.Custom, 
                CustomProfileFields = "first-name,email-address,last-name,formatted-name,id,industry" 
            }); 

2. Retrieve custom profile fields as json from Identity model "UserData" claim. 
3. References: 
https://github.com/aspnet/Security/tree/dev/src 
https://auth0.com/blog/authenticating-a-user-with-linkedin-in-aspnet-core/ 
https://developer.linkedin.com/docs/signin-with-linkedin
